import React, { Component } from "react";

class TotalTime extends Component {
  static defaultProps = {
    totalTime: "00:00:00"
  };

  render() {
    // const { totalTime } = this.props;
    return (
      <div>
        <div>Total Time here</div>
        <div>{this.props.TotalTime}</div>
      </div>
    );

    //<div>{this.props.totalTime}</div>;
  }
}

export default TotalTime;
